ch might possibly leave a casual observer who hadn't followed the trial, with a belief that her findings were possibly discredited in some way) - is just bad, though.  It was completely the opposite.  This had to do with only a brief time to wrap the last 3-4 weeks of trial up in 5 minutes.\n\nVERDICT: State of Arizona vs. Jodi Arias (for the Murder of Travis Alexander).\n\nCOUNT 1: First Degree Murder (Premeditated) GUILTY: 5 jurors\nCOUNT 1: Felony Murder (no votes)\nCOUNT 1: BOTH First Degree Premeditated AND Felony Murder GUILTY: 7 Jurors\n\nJUSTICE4TRAVIS (and family) AT LAST!\n\n\"If I ever hurt Travis - if I ever KILLED Travis - I would BEG FOR the Death Penalty\" ~ Jodi Arias 07-15-08\n\n\"If I did that, I'd be fully ready to face the consequences...I'm all for the ten commandments - thou shalt not kill.\" ~ Jodi Arias 07-15-08"}]},"subscribeButton":{"buttonRenderer":{"style":"STYLE_DESTRUCTIVE","size":"SIZE_DEFAULT","isDisabled":false,"text":{"runs":[{"text":"Subscribe"}]},"navigationEndpoint":{"clickTrackingParams":"CJMBEJsrIhMI6f_QtYya6gIV2OZRCh2bggBz","commandMetadata":{"webCommandMetadata":{"ignoreNavigation":true}},"modalEndpoint":{"modal":{"modalWithTitleAndButtonRenderer":{"title":{"simpleText":"Want to subscribe to this channel?"},"content":{"simpleText":"Sign in to subscribe to this channel."},"button":{"buttonRenderer":{"style":"STYLE_BLUE_TEXT","size":"SIZE_DEFAULT","isDisabled":false,"text":{"simpleText":"Sign in"},"navigationEndpoint":{"clickTrackingParams":"CJQBEP2GBCITCOn_0LWMmuoCFdjmUQodm4IAczIJc3Vic2NyaWJl","commandMetadata":{"webCommandMetadata":{"url":"https://accounts.google.com/ServiceLogin?service=youtube\u0026uilel=3\u0026passive=true\u0026continue=https%3A%2F%2Fwww.youtube.com%2Fsignin%3Faction_handle_signin%3Dtrue%26app%3Ddesktop%26hl%3Den%26next%3D%252Fwatch%253Fv%253DA2XvzoNqUh8%26continue_action%3DQUFFLUhqbUc2b2M2RGVra0ZmYWZSNG44YlI2X2lIQWlPUXxBQ3Jtc0tuYjRONWlHMUdCVjc3U01rN3BidG1sclB5OXpjT1FmREd2QXg4VmE2Q0M3QVd5Ul9rRTlnVjZPTnJ5Vl           };
          return {
            data: data,
            endpoint: endpoint
          };
        };

        if (window.loadDataHook) {
          var pageData = window.getPageData();
          window.loadDataHook(pageData.endpoint, pageData.data);
          window.loadDataHook = null;
        }
        setFiller();

    })();
  </script>

   if (window.ytcsi) {window.ytcsi.info("st", 452, '');}
  </script>
